			clearInterval(interval);
			my_local.c.alpha = 0;
			my_local.gotoAndPlay(Math.ceil((my_local.cur.y - 188)/2));
			my_local.cur.removeEventListener("pressmove", productMove1);
			my_local.cur.removeEventListener("pressup", productStopMove1);
			my_local.cur.removeEventListener("mousedown", productDown1);
